    alt: 'Web Budějčanda',
    name: 'Budějčanda',
    info: 'Frontendová část webu',
  },*/
  {
    id: '06',
    img: `${gerta}`,
    alt: 'Web SlavkaVav',
    name: 'SlavkaVav',
    info: 'React',
  },
  {
    id: '05',
    img: `${gerta}`,
    alt: 'Web Pension Gerta',
    name: 'Pension Gerta',
    info: 'Web se šablonou Eleventy',
  },
  {
    id: '04',
    img: `${appkaHyposka}`,
    alt: 'Web Appka Hypoška',
    name: 'Appka Hypoška',
    info: 'Závěrečný projekt Digitální akademie',
  },
  {
    id: '03',
    img: `${statek}`,
    alt: 'Web Statek Chlumeček',
    name: 'Statek Chlumeček',
    info: 'WordPress',
  },
  {
    id: '02',
    img: `${chataRuzenka}`,
    alt: 'Web Chata Růženka',
    name: 'Chata Růženka',
    info: 'WordPress',
  },

  {
    id: '01',
    img: `${chataGerta}`,
    alt: 'Web Chata Gerta',
    name: 'Chata Gerta',
    info: 'WordPress',
  },
];

export default Portfolio;
